// main.js
import Vue from 'vue';
import VueRouter from 'vue-router';
import App from './App.vue';
import LoginForm from "./components/login-form.vue";  // Updated filename
import Dashboard from "./components/dashBoard.vue";  // Updated filename
import Profile from './components/profile-form.vue';  // Updated filename

Vue.config.productionTip = false;

Vue.use(VueRouter);

const routes = [
  { path: '/', component: LoginForm },
  { path: '/dashboard', name: 'Dashboard', component: Dashboard },
  { path: '/profile', name: 'Profile', component: Profile },
];

const router = new VueRouter({
  routes,
});

new Vue({
  render: (h) => h(App),
  router,
}).$mount('#app');
